export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},Y2ki3feOlI:{data:{id:2318,attributes:{imdbId:"tt0407304",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNDUyODAzNDI1Nl5BMl5BanBnXkFtZTcwMDA2NDAzMw@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"},{Source:"Rotten Tomatoes",Value:"75%"},{Source:"Metacritic",Value:"73\u002F100"}],item_lang:{data:{id:2981,attributes:{title:g,plot:"An ordinary man has to protect his children against alien invaders in this science fiction action film freely adapted from the classic story by H.G. Wells. Ray Ferrier (Tom Cruise) is a dockworker living in New Jersey, divorced from his first wife Mary Ann (Miranda Otto) and estranged from his two children Rachel and Robbie (Dakota Fanning and Justin Chatwin), of whom he has custody on weekends. On one such visitation, looking after the kids becomes a little more difficult when, after a series of strange lighting storms hit his neighborhood, Ray discovers that a fleet of death-ray robotic spaceships have emerged nearby, part of the first wave of an all-out alien invasion of the Earth. Transporting his children from New York to Boston in an attempt to find safety at Mary Ann's parents' house, Ray must learn to become the protector and provider he never was in marriage.",slug:"war-of-the-worlds"}}},books:{data:[{id:11271,attributes:{title:g,description:"When an army of invading Martians lands in England, panic and terror seize the population. As the aliens traverse the country in huge three-legged machines, incinerating all in their path with a heat ray and spreading noxious toxic gases, the people of the Earth must come to terms with the prospect of the end of human civilization and the beginning of Martian rule. Inspiring films, radio dramas, comic-book adaptations, television series and sequels, The War of the Worlds is a prototypical work of science fiction which has influenced every alien story that has come since, and is unsurpassed in its ability to thrill, well over a century since it was first published.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AydXvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:true,published:"2017-04-01",publisher:"Alma Books",subtitle:a}},{id:11272,attributes:{title:"WAR OF THE WORLDS.",description:a,thumbnail:a,authors:["H. G. WELLS"],firstBook:c,published:"2015-01-01",publisher:a,subtitle:a}},{id:11273,attributes:{title:"The War of the Worlds by H. G. Wells - Delphi Classics (Illustrated)",description:"This eBook features the unabridged text of ‘The War of the Worlds’ from the bestselling edition of ‘The Complete Works of H. G. Wells’. Having established their name as the leading publisher of classic literature and art, Delphi Classics produce publications that are individually crafted with superior formatting, while introducing many rare texts for the first time in digital print. The Delphi Classics edition of Wells includes original annotations and illustrations relating to the life and works of the author, as well as individual tables of contents, allowing you to navigate eBooks quickly and easily. eBook features: * The complete unabridged text of ‘The War of the Worlds’ * Beautifully illustrated with images related to Wells’s works * Individual contents table, allowing easy navigation around the eBook * Excellent formatting of the textPlease visit www.delphiclassics.com to learn more about our wide range of titles",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FpPWDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:c,published:"2017-07-17",publisher:"Delphi Classics",subtitle:a}},{id:11274,attributes:{title:"The War of the Worlds. H. G. Wells. Fremdsprachentext Englisch",description:"H. G. Wells' legendärer Science Fiction Roman \"The War of the Worlds\" als Fremdsprachentext Englisch mit 31 Illustrationen von Alvim Corrêa. Nobody knows how long the Martians have been observing our world. But one day they set off. They want to seize the reign on Earth. As species, they are far superior to humans. The battle seems hopeless and the end of humanity is sealed ... \"The War of the Worlds\" is a fundamental work of science fiction literature and has been filmed and adapted several times. Wells wrote the novel as a satire on the colonial politics of the Empire. He has exchanged the roles of conquerors and victims to the disadvantage of the British. The edition contains 31 illustrations that Alvim Corrêa has created especially for a Belgian luxury edition.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8BOIDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:c,published:"2019-02-14",publisher:"BoD – Books on Demand",subtitle:"Illustrations by Alvim Corrêa"}},{id:11275,attributes:{title:"The War of the Worlds - H.G. Wells",description:"The War of the Worlds (1898), by H. G. Wells, is an early science fiction novel which describes an invasion of England by aliens from Mars. It is one of the earliest and best-known depictions of an alien invasion of Earth, and has influenced many others, as well as spawning several films, radio dramas, comic book adaptations, and a television series based on the story. The 1938 radio broadcast caused public outcry against the episode, as many listeners believed that an actual Martian invasion was in progress, a notable example of mass hysteria.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VGAwEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["H.G. Wells"],firstBook:c,published:"2021-06-10",publisher:"Phoemixx Classics Ebooks",subtitle:a}}]}}},meta:{}}},prerenderedAt:1682568382649}}("","movie",null,"H. G. Wells","series",1,"War of the Worlds"))